import {useState} from "react";
import * as PropTypes from "prop-types";

/**
 * Text field react component
 * @param props
 * @constructor
 */
function TextField({value, onChange, type, startIcon}) {
    return <div className="relative">
        <div className="absolute top-1/2 left-2 -translate-y-1/2">{startIcon}</div>
        <input className="pr-3 py-2 pl-6 border rounded-md bg-gray-200" type={type} value={value} onChange={e => onChange(e.target.value)}/>
    </div>
}

TextField.propTypes = {
    onChange: PropTypes.func,
    startIcon: PropTypes.element,
    type: PropTypes.string,
    value: PropTypes.string
};

/**
 * Login form react component
 * @returns {null}
 * @constructor
 */
export function LoginForm() {
    const [email, setEmail] = useState('');

    function handleSubmit(e){
        e.preventDefault();
    }

    return <div>
        <form onSubmit={handleSubmit}>
            <TextField value={email} startIcon={<h1>asdf</h1>} onChange={setEmail} type="text" />
        </form>
    </div>
}
